import React, { useState } from 'react'

export default function TaskList() {

  const [listItems, setListItems] = useState(['Item 1', 'Item 2', 'Item 3'])

  function handleInputChange(event, index) {
    const newListItems = [...listItems]
    newListItems[index] = event.target.value
    setListItems(newListItems)
  }

  return (
    <div>
      <h1>Task List</h1>
      <ul>
        {listItems.map((item, index) => (
          <li key={index}>
            <input value={item} onChange={(e) => {handleInputChange(e, index)}} className="task"></input>
          </li>
        ))}
      </ul>
      <input></input>
      <button onClick={() => setListItems([...listItems, 'Start typing...'])}>

      </button>
    </div>
  );
}
